import React from 'react'
import { Link } from "react-router-dom"
import Navigation from './component/Navigation';

function App() {
  return (
    <>
    <Navigation/>
    <>
      <Link to="/create">Create</Link>
      <Link to="/read">Read</Link>
      <Link to="/update">Update</Link>
    </>
    </>
  )
}

export default App
